pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract KYC {
    address public owner;
    uint256 currentUserCount;

    mapping(address=>bool) isAdmin;
    event OwnerChanged(address indexed _from,address indexed _to);
    event AdminAdded(address indexed Admin_Address);
    event AdminRemoved(address indexed Admin_Address);
    
    constructor() public{
        owner=msg.sender;
        isAdmin[msg.sender]=true;
        currentUserCount = 1;
    }
    
    modifier onlyOwner(){
        require(owner == msg.sender,"Only Owner has permission to do that action!");
        _;
    }
    modifier onlyAdmin(){
        require(isAdmin[msg.sender] == true,"Only Admin has permission to do that action!");
        _;
    }
    
    function setOwner(address _owner) public onlyOwner returns(bool success){
        require(msg.sender!=_owner,"You are already the owner!");
        owner = _owner;
        emit OwnerChanged(msg.sender, _owner);
        return true;
    }

    function addAdmin(address _address) public onlyOwner returns(bool success){
        require(!isAdmin[_address],"User is already an admin!");
        isAdmin[_address]=true;
        emit AdminAdded(_address);
        return true;
    }

    function removeAdmin(address _address) public onlyOwner returns(bool success){
        require(_address!=owner,"Can't remove owner from admin");
        require(isAdmin[_address],"User is not an admin!");
        isAdmin[_address]=false;
        emit AdminRemoved(_address);
        return true;
    }

    struct Bank {
        uint256 id;
        string bName;
        string bAddress;
        string bContact;
        address addr;
        bool isApproved;
    }
    
    uint256 public index;
    mapping(address=>bool) isBank;
    mapping(address=>Bank) Banks;
    address[] public BankList;
    
    modifier onlyBank(){
        require(isBank[msg.sender],"Only Banks can add a customer");
        _;
    }
    
    function addBank(string memory _bName,string memory _bAddress,string memory _bContact,address _addr) public onlyAdmin{
        require(!isBank[_addr],"Already a Bank");
        BankList.push(_addr);
        index = index + 1;
        isBank[_addr]=true;
        Banks[_addr]=Bank(index,_bName,_bAddress,_bContact,_addr,true);
    }
    
    function getBankById(uint256 _id) public onlyAdmin view returns(uint256 id,string memory bName,string memory bAddress , string memory bContact ,address addr , bool isApproved){
        uint256 i=0;
        for(;i<BankList.length;i++){
            if(Banks[BankList[i]].id==_id){
                break;
            }
        }    
        require(Banks[BankList[i]].id==_id,"Bank ID doesn't exists");
        Bank memory tmp = Banks[BankList[i]];
        return (tmp.id,tmp.bName,tmp.bAddress,tmp.bContact,tmp.addr,tmp.isApproved);
    }
    
    function getBankByAddress(address _address) public onlyAdmin view returns(uint256 id,string memory bName,string memory bAddress , string memory bContact ,address addr , bool isApproved){
        require(Banks[_address].isApproved,"Bank is not Approved or doesn't exist");
        Bank memory tmp = Banks[_address];
        return (tmp.id,tmp.bName,tmp.bAddress,tmp.bContact,tmp.addr,tmp.isApproved);
    } 

    // uint256 public pindex=0;
    
    struct Records {
        string bName;
        string ipfs;
    }
    
    struct Customer{
        uint kycId;
        string pwdHash;
        string name;
        string phone;
        string gender;
        string dob;
        string PAN;
        Records[] records;
    }

    string[] private CustomerList;
    Customer[] public CustomerDetailList;
    // mapping(address=>mapping(address=>bool)) isAuth;
    mapping(uint=>mapping(address=>bool)) isBankAuth; //userId -> address of Bank -> bool
    mapping(string=>bool) isUserAuth; 
    mapping(uint=>Customer) Customers;
    mapping(uint=>bool) isCustomer;
    mapping(string=>bool) isCustomerFromPAN;
    mapping(string=>uint) PAN2KycId;
    // uint256[] public customerIds;
    // mapping(uint=>string) kycId2userName;
    
    function addRecord(uint _kycId,string memory _bName, string memory _ipfs) public onlyBank{
        require(isCustomer[_kycId],"User Not registered");
        require(isBankAuth[_kycId][msg.sender],"No permission to add Records");
        Customers[_kycId].records.push(Records(_bName, _ipfs));        
    }
    
    event Testing(uint tmp);

    function addCustomer(string memory _name, string memory _phone, string memory _gender, string memory _dob, string memory _PAN) public onlyBank returns(uint){
        uint _kycId = PAN2KycId[_PAN];
        require(!isCustomer[_kycId],"Already Customer account exists");

        _kycId = genRandom();
        while(isCustomer[_kycId]){
            _kycId = genRandom();
        }        
        emit Testing(_kycId);
        Customers[_kycId].kycId = _kycId;
        isCustomer[_kycId] = true;

        // CustomerList.push(_userName);
        // pindex = pindex + 1;
        // isCustomer[_userName]=true;
        // isAuth[msg.sender][msg.sender]=true;
        // Customers[_userName].id=pindex;
        Customers[_kycId].name=_name;
        Customers[_kycId].phone=_phone;
        Customers[_kycId].gender=_gender;
        Customers[_kycId].dob=_dob;
        Customers[_kycId].PAN = _PAN;
        PAN2KycId[_PAN] = _kycId;
        // Customers[_userName].addr=msg.sender;
        // isCustomerFromPAN[_PAN] = true;
        // kycId2userName[temp] = _userName;

        currentUserCount += 1;
        CustomerDetailList.push(Customers[_kycId]);
        return _kycId;
    }
    
    function getKycIdFromPAN(string memory _PAN) public onlyBank view returns(uint){
        uint _kycId = PAN2KycId[_PAN];
        require(isCustomer[_kycId],"No Customer found with given PAN");
        return PAN2KycId[_PAN];
    }

    function getCustomerDetails(uint _kycId) public onlyBank  view returns(string memory _name,string memory _phone,string memory _gender,string memory _dob){
        // string memory userName = kycId2userName[_kycId];
        require(isBankAuth[_kycId][msg.sender],"No permission to get Records");
        require(isCustomer[_kycId],"No Customers found at the given address");
        Customer memory tmp = Customers[_kycId];
        return (tmp.name,tmp.phone,tmp.gender,tmp.dob);
    }
    
    function getCustomerRecords(uint _kycId) public onlyBank  view returns(string[] memory _bName, string[] memory ipfs){
        require(isBankAuth[_kycId][msg.sender],"No permission to get Records");
        require(isCustomer[_kycId],"Customer not signed in to our network");
        require(Customers[_kycId].records.length>0,"Customer record doesn't exist");
        string[] memory bName = new string[](Customers[_kycId].records.length);
        string[] memory IPFS = new string[](Customers[_kycId].records.length);
        for(uint256 i=0;i<Customers[_kycId].records.length;i++){
            bName[i]=Customers[_kycId].records[i].bName;
            IPFS[i]=Customers[_kycId].records[i].ipfs;
        }
        return(bName, IPFS);
    }
    
    function addAuth(uint _kycId, address _bankAddress) public onlyAdmin returns(bool success) {
        require(!isBankAuth[_kycId][_bankAddress],"Already Authorised");
        require(msg.sender!=_bankAddress,"Cant add yourself");
        isBankAuth[_kycId][_bankAddress] = true;
        return true;
    }

    function revokeAuth(uint _kycId, address _bankAddress) public onlyAdmin returns(bool success) {
        require(msg.sender!=_bankAddress,"Cant remove yourself");
        require(isBankAuth[_kycId][_bankAddress],"Already Not Authorised");
        isBankAuth[_kycId][_bankAddress] = false;
        return true;
    }
    
    // function addAuthFromTo(address _from,address _to) public returns(bool success) {
    //     require(!isAuth[_from][_to],"Already  Auth!!!");
    //     require(_from!=_to,"can't add same person");
    //     require(isAuth[_from][msg.sender],"You don't have permission to access");
    //     require(isCustomerFromAddress[_from],"User Not Registered yet");
    //     isAuth[_from][_to] = true;
    //     return true;
    // }
    
    // function removeAuthFromTo(address _from,address _to) public returns(bool success) {
    //     require(isAuth[_from][_to],"Already No Auth!!!");
    //     require(_from!=_to,"can't remove same person");
    //     require(isAuth[_from][msg.sender],"You don't have permission to access");
    //     require(isCustomerFromAddress[_from],"User Not Registered yet");
    //     isAuth[_from][_to] = false;
    //     return true;
    // }  

    function genRandom() private view returns (uint) {
        uint rand = uint(keccak256(abi.encodePacked(blockhash(block.number-1))));
        return uint(rand % (10 ** 20));
    }
}
